TRUNCATE TABLE pim_transfers RESTART IDENTITY;

-- Insert batch #1

-- RESET ESTABLISHMENTS PK AND SEQUENCE COUNT
SELECT MAX(id) pim_transfers_max_id FROM pim_transfers;
SELECT nextval('pim_transfers_id_seq') AS pim_transfers_nextval;
SELECT setval('pim_transfers_id_seq', (SELECT MAX(id) FROM pim_transfers)) AS pim_transfers_setval;
SELECT setval('pim_transfers_id_seq', COALESCE((SELECT MAX(id)+1 FROM pim_transfers), 1), false) AS pim_transfers_val;
